import '../App.css';

import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';


function Navbar() {
    return ( <div className="navbar">
        <div className="rightSide">
            <div className="Link">
                <a href="/user">Chanakan</a>
                <></>
            </div>
        </div>

    </div>
        
    );
}

export default Navbar;
